function Button(props) {
    function submit() {
        const object = props.updatedFormContents;
      for (let i = 0; i < object.length; i++) {
        const array = object[i];
        console.log(array)
      }
    }

    return (
        <button className="button" onClick={submit}>Add Transaction</button>
    );
}

export default Button;
